import React from "react";
import styled from "styled-components";
import {
  Container,
  SubHeader,
  SubText,
  CaptionText
} from "../../styledComponents";
import { Avatar } from "@material-ui/core";
import MailIcon from "@material-ui/icons/Mail";

const Overview = () => {
  return (
    <Container flex={1} customStyles={{ paddingTop: 30 }}>
      <Container row center flex={1} customStyles={{ width: "100%" }}>
        <Avatar
          style={{
            backgroundColor: "purple",
            width: 35,
            height: 35,
            alignItems: "center",
            justifyContent: "center"
          }}
        >
          <MailIcon style={{ fontSize: 20 }} />
        </Avatar>
        <Container
          column
          space="space-evenly"
          flex={1}
          customStyles={{ width: "100%" }}
        >
          <SubHeader customStyles={{ fontSize: 15 }}>
            Latest maintenance issues
          </SubHeader>
          <CaptionText>View recent ticket on Barcelona</CaptionText>
        </Container>
      </Container>
    </Container>
  );
};

export default Overview;
